import React, { useState, useEffect } from 'react';
import axios from 'axios';
import styled from 'styled-components';

const StyledForm = styled.form`
  max-width: 800px;
  margin: 0 auto;
  padding: 2rem;
  background-color: #f9fafb;
  border-radius: 0.5rem;
  box-shadow: 0 10px 15px -3px rgba(0, 0, 0, 0.1);

  h2 {
    font-size: 1.75rem;
    font-weight: 700;
    margin-bottom: 1.5rem;
    color: #1f2937;
    text-align: center;
  }

  section {
    margin-bottom: 2rem;
    background-color: white;
    padding: 1.5rem;
    border-radius: 0.5rem;
    box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1);
  }

  h3 {
    font-size: 1.25rem;
    font-weight: 600;
    margin-bottom: 1rem;
    color: #374151;
    border-bottom: 1px solid #e5e7eb;
    padding-bottom: 0.5rem;
  }

  .grid {
    display: grid;
    grid-template-columns: 1fr;
    gap: 1rem;
  }

  input, select {
    width: 100%;
    padding: 0.75rem;
    border: 1px solid #d1d5db;
    border-radius: 0.375rem;
    font-size: 1rem;
    background-color: #fff;
    transition: border-color 0.15s ease-in-out, box-shadow 0.15s ease-in-out;

    &:focus {
      outline: none;
      border-color: #3b82f6;
      box-shadow: 0 0 0 3px rgba(59, 130, 246, 0.3);
    }
  }

  select[multiple] {
    height: 120px;
  }

  button {
    width: 100%;
    background-color: #3b82f6;
    color: white;
    padding: 0.75rem 1rem;
    border-radius: 0.375rem;
    font-weight: 600;
    font-size: 1rem;
    border: none;
    cursor: pointer;
    transition: background-color 0.15s ease-in-out;

    &:hover {
      background-color: #2563eb;
    }

    &:focus {
      outline: none;
      box-shadow: 0 0 0 3px rgba(59, 130, 246, 0.5);
    }
  }

  @media (max-width: 768px) {
    padding: 1rem;

    section {
      padding: 1rem;
    }
  }
`;

const SignUpForm = () => {
  const [formData, setFormData] = useState({
    fullName: '',
    gender: '',
    nationality: '',
    ageGroup: '',
    course: '',
    academicLevel: '',
    subjectsEnrolled: [],
    studyPreference: '',
    availability: [],
    learningStyle: '',
    motivationalFactors: [],
    studyEnvironment: [],
    academicSkills: [],
    hobbies: [],
    interests: [],
    careerAspirations: '',
    communicationChannels: [],
    toolsProficiency: [],
    locationPreference: '',
    languagesSpoken: '',
    studyPartnerPreference: '',
    groupProjectExperience: '',
    willingnessToMentor: ''
  });

  useEffect(() => {
    const savedData = localStorage.getItem('signUpFormData');
    if (savedData) {
      setFormData(JSON.parse(savedData));
    }
  }, []);

  const handleChange = (e) => {
    const { name, value, type, options } = e.target;
    let updatedValue;

    if (type === 'select-multiple') {
      updatedValue = Array.from(options).filter(option => option.selected).map(option => option.value);
    } else {
      updatedValue = value;
    }

    const updatedFormData = {
      ...formData,
      [name]: updatedValue
    };
    setFormData(updatedFormData);
    localStorage.setItem('signUpFormData', JSON.stringify(updatedFormData));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/api/signup', formData);
      console.log('Sign up successful', response.data);
      localStorage.removeItem('signUpFormData');
      // Handle successful signup (e.g., redirect, show success message)
    } catch (error) {
      console.error('Sign up failed', error);
      // Handle error (e.g., show error message)
    }
  };

  // Define options for various fields
  const courses = ['Bachelor\'s', 'Master\'s'];
  const genders = ['Male', 'Female', 'Non-Binary', 'Prefer not to say'];
  const studyPreferences = ['Group', 'Individual'];
  const locationPreferences = ['In-person', 'Online'];
  const ageGroups = ['18-21','22-25','26-29','30+'];
  const semesters = ['Sem 1','Sem 2','Sem 3','Sem 4','Sem 5','Sem 6','Sem 7','Sem 8'];
  const hobbies = ['Reading', 'Gaming', 'Hiking', 'Cooking', 'Painting', 'Music', 'Sports', 'Photography', 'Dance', 'Yoga', 'Cycling', 'Chess', 'Running', 'Robotics', 'Writing'];
  const interests = ['Environmental Activism', 'Tech Entrepreneurship', 'Cultural Studies', 'Travel', 'Mental Health Advocacy', 'Open Source Contributions', 'Wildlife Conservation', 'Philosophy', 'Financial Literacy Education', 'Renewable Energy', 'Community Service', 'Art Exhibitions', 'Language Learning', 'Culinary Arts', 'Digital Marketing', 'Volunteering', 'Group Entertainment', 'DJ', 'Independent Music', 'Baking'];
  const subjectsBachelors = ['Mathematics', 'Physics', 'Chemistry', 'Biology', 'Computer Science', 'Economics', 'Psychology', 'Sociology', 'Literature', 'History', 'Political Science', 'Engineering Fundamentals','Geography'];
  const subjectsMasters = ['Data Science', 'Machine Learning', 'Business Administration', 'Marketing', 'Cybersecurity', 'Artificial Intelligence', 'Mechanical Engineering', 'Finance', 'Environmental Science', 'Education Leadership', 'International Relations', 'Design Future', 'International Business', 'Urban Development','Architecture'];
  const availabilityOptions = ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'];
  const learningStyles = ['Visual', 'Auditory', 'Reading/Writing', 'Kinesthetic'];
  const motivationalFactors = ['Deadlines', 'Collaboration', 'Personal Goals', 'Competition'];
  const studyEnvironments = ['Quiet Spaces', 'Group Study Rooms', 'Cafes', 'Library'];
  const strengths = ['Problem-Solving', 'Research', 'Presentation', 'Time Management', 'Analytical Thinking'];
  const careerAspirations = ['Data Scientist','Project Manager','Business Analyst','Software Engineer','Supply Chain Manager'];
  const communicationChannels = ['Email', 'Slack', 'WhatsApp', 'In-Person'];
  const toolsTechnologies = ['Excel', 'Python', 'SQL', 'Power Point', 'Office 365', 'Adobe Illustration', 'Editing Tools', 'Animation Tools'];
  const studyPartnerPreferences = ['Focused', 'Relaxed', 'Collaborative', 'Competitive'];
  const yesNoOptions = ['Yes', 'No'];

  return (
    <StyledForm onSubmit={handleSubmit}>
      <h2>Student Sign Up</h2>

      <section>
        <h3>Personal Information</h3>
        <div className="grid">
          <input
            type="text"
            name="fullName"
            value={formData.fullName}
            onChange={handleChange}
            placeholder="Full Name"
            required
          />
          <select
            name="gender"
            value={formData.gender}
            onChange={handleChange}
            required
          >
            <option value="">Select Gender</option>
            {genders.map(gender => (
              <option key={gender} value={gender}>{gender}</option>
            ))}
          </select>
          <input
            type="text"
            name="nationality"
            value={formData.nationality}
            onChange={handleChange}
            placeholder="Nationality"
            required
          />
          <select
            name="ageGroup"
            value={formData.ageGroup}
            onChange={handleChange}
            required
          >
            <option value="">Select Age Group</option>
            {ageGroups.map(age => (
              <option key={age} value={age}>{age}</option>
            ))}
          </select>
        </div>
      </section>

      <section>
        <h3>Academic Information</h3>
        <div className="grid">
          <select
            name="course"
            value={formData.course}
            onChange={handleChange}
            required
          >
            <option value="">Select Course</option>
            {courses.map(course => (
              <option key={course} value={course}>{course}</option>
            ))}
          </select>
          <select
            name="academicLevel"
            value={formData.academicLevel}
            onChange={handleChange}
            required
          >
            <option value="">Select Semester</option>
            {semesters.map(semester => (
              <option key={semester} value={semester}>{semester}</option>
            ))}
          </select>
          <select
            name="subjectsEnrolled"
            value={formData.subjectsEnrolled}
            onChange={handleChange}
            multiple
            required
          >
            {formData.course === 'Bachelor\'s' 
              ? subjectsBachelors.map(subject => (
                  <option key={subject} value={subject}>{subject}</option>
                ))
              : subjectsMasters.map(subject => (
                  <option key={subject} value={subject}>{subject}</option>
                ))
            }
          </select>
          <select
            name="studyPreference"
            value={formData.studyPreference}
            onChange={handleChange}
            required
          >
            <option value="">Study Preference</option>
            {studyPreferences.map(pref => (
              <option key={pref} value={pref}>{pref}</option>
            ))}
          </select>
          <select
            name="availability"
            value={formData.availability}
            onChange={handleChange}
            multiple
            required
          >
            {availabilityOptions.map(day => (
              <option key={day} value={day}>{day}</option>
            ))}
          </select>
        </div>
      </section>

      <section>
        <h3>Personality and Study Habits</h3>
        <div className="grid">
          <select
            name="learningStyle"
            value={formData.learningStyle}
            onChange={handleChange}
            required
          >
            <option value="">Learning Style</option>
            {learningStyles.map(style => (
              <option key={style} value={style}>{style}</option>
            ))}
          </select>
          <select
            name="motivationalFactors"
            value={formData.motivationalFactors}
            onChange={handleChange}
            multiple
            required
          >
            {motivationalFactors.map(factor => (
              <option key={factor} value={factor}>{factor}</option>
            ))}
          </select>
          <select
            name="studyEnvironment"
            value={formData.studyEnvironment}
            onChange={handleChange}
            multiple
            required
          >
            {studyEnvironments.map(env => (
              <option key={env} value={env}>{env}</option>
            ))}
          </select>
          <select
            name="academicSkills"
            value={formData.academicSkills}
            onChange={handleChange}
            multiple
            required
          >
            {strengths.map(strength => (
              <option key={strength} value={strength}>{strength}</option>
            ))}
          </select>
        </div>
      </section>

      <section>
        <h3>Interests and Hobbies</h3>
        <div className="grid">
          <select
            name="hobbies"
            value={formData.hobbies}
            onChange={handleChange}
            multiple
            required
          >
            {hobbies.map(hobby => (
              <option key={hobby} value={hobby}>{hobby}</option>
            ))}
          </select>
          <select
            name="interests"
            value={formData.interests}
            onChange={handleChange}
            multiple
            required
          >
            {interests.map(interest => (
              <option key={interest} value={interest}>{interest}</option>
            ))}
          </select>
          <select
            name="careerAspirations"
            value={formData.careerAspirations}
            onChange={handleChange}
            required
          >
            <option value="">Future Career Aspirations</option>
            {careerAspirations.map(career => (
              <option key={career} value={career}>{career}</option>
            ))}
          </select>
        </div>
      </section>

      <section>
        <h3>Technical/Work Preferences</h3>
        <div className="grid">
          <select
            name="communicationChannels"
            value={formData.communicationChannels}
            onChange={handleChange}
            multiple
            required
          >
            {communicationChannels.map(channel => (
              <option key={channel} value={channel}>{channel}</option>
            ))}
          </select>
          <select
            name="toolsProficiency"
            value={formData.toolsProficiency}
            onChange={handleChange}
            multiple
            required
          >
            {toolsTechnologies.map(tool => (
              <option key={tool} value={tool}>{tool}</option>
            ))}
          </select>
          <select
            name="locationPreference"
            value={formData.locationPreference}
            onChange={handleChange}
            required
          >
            <option value="">Location Preference</option>
            {locationPreferences.map(pref => (
              <option key={pref} value={pref}>{pref}</option>
            ))}
          </select>
          <input
            type="text"
            name="languagesSpoken"
            value={formData.languagesSpoken}
            onChange={handleChange}
            placeholder="Languages Spoken"
            required
          />
        </div>
      </section>

      <section>
        <h3>Social and Team Preferences</h3>
        <div className="grid">
          <select
            name="studyPartnerPreference"
            value={formData.studyPartnerPreference}
            onChange={handleChange}
            required
          >
            <option value="">Preferred Study Partner Personality</option>
            {studyPartnerPreferences.map(pref => (
              <option key={pref} value={pref}>{pref}</option>
            ))}
          </select>
          <select
            name="groupProjectExperience"
            value={formData.groupProjectExperience}
            onChange={handleChange}
            required
          >
            <option value="">Past Group Project Experience</option>
            {yesNoOptions.map(option => (
              <option key={option} value={option}>{option}</option>
            ))}
          </select>
          <select
            name="willingnessToMentor"
            value={formData.willingnessToMentor}
            onChange={handleChange}
            required
          >
            <option value="">Willingness to Mentor Others</option>
            {yesNoOptions.map(option => (
              <option key={option} value={option}>{option}</option>
            ))}
          </select>
        </div>
      </section>

      <button type="submit">Sign Up</button>
    </StyledForm>
  );
};

export default SignUpForm;
